高级用法 -- 倒计时
倒计时 Toast

openCustomizedToast() {
      let second = 5
      const toast = SunToast({
        duration: second * 1000,
        message: `倒计时 ${second} 秒`,
        iconType: 'loading'
      })

      const timer = setInterval(() => {
        second--
        if (second) {
          toast.message = `倒计时 ${second} 秒`
        } else {
          clearInterval(timer)
        }
      }, 1000)
    }

