src/packages/base/list/.body:
List 列表
瀑布流滚动加载，用于控制长列表的展示
使用指南
import SunList from 'sun-rice';

Vue.use(SunList);

代码演示
基础用法




export default {
  data() {
    return {
      list: [],
      loading: false,
      finished: false
    };
  },

  methods: {
    onLoad() {
      setTimeout(() => {
        for (let i = 0; i = 40) {
          this.finished = true;
        }
      }, 500);
    }
  }
}

